import React, { useEffect, useState } from "react";
import axios from "axios";
import UserData from "./UserData";

const Table = () => {
  const [data, setData] = useState([]);

  const getUserData = async () => {
    const res = await axios.get("/getAllUser", {
      headers: {
        "Content-Type": "application/json",
      },
    });

    if (res.data.status === 401 || !res.data) {
      console.log("Error!!");
    } else {
      setData(res.data.allUser);
    }
  };

  useEffect(() => {
    fetch("http://localhost:8005/getAllUser")
  }, []);

  return (
    <>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Gender</th>
            <th>Income</th>
            <th>City</th>
            <th>Car</th>
            <th>Quote</th>
            <th>Phone price</th>
          </tr>
        </thead>
        <tbody>
          <UserData users={data} />
        </tbody>
      </table>
    </>
  );
};

export default Table;
